const a={"maze-bank":{cardTitle:"Maze-Bank clone",cardDescription:"Clone do site Maze-Bank do jogo GTA V",name:"Réplica do site Maze-Bank | GTA V","paragraph-0":'Projeto criado para praticar criação de <i>web pages</i> utilizando html e pré-processador de css, utilizando scss. A página se trata de uma réplica de um site dentro do jogo <i>grand theft auto V</i>, se tratando de uma página de banco onde o jogador tivesse a possibilidade de verificar seu saldo, sacar e depositar dinheiro dentro do jogo. O projeto se encontra disponível para navegação neste link: <a href="https://leonardobevilacqua.github.io/Maze-Bank">https: //leonardobevilacqua.github.io/Maze-Bank</a>.',"paragraph-1":"Maze bank | página principal","paragraph-2":"Maze bank | histórico de transações"},"lista-interativa":{cardTitle:"Lista interativa",cardDescription:"Mini projeto CSS",name:"Lista interativa | Mini projeto CSS","paragraph-0":'Este projeto pequeno se trata de uma lista de itens, na qual existe a possibilidade de editar e excluir de forma fácil e minimalista, utilizando apenas ícones, e adicionar itens sem atualizar a pagina atual. O projeto se encontra disponível para navegação neste link: <a href="https://leonardobevilacqua.github.io/Lista-interativa/index.html">https://leonardobevilacqua.github.io/Lista-interativa/index.html</a>',"paragraph-1":"Lista interativa"},"choose-your-game":{cardTitle:"Choose Your Game",cardDescription:"Uma rede social para gamers",name:"Choose Your Game | Uma rede social para gamers","paragraph-0":"Projeto do 5º semestre de CCO, com foco de criar uma aplicação web.","paragraph-1":'O projeto se trata de uma Rede social com foco em games, voltado para discussão sobre o assunto, analises e outros. Foi realizado todo o planejamento como funcionaria o site usando a ferramenta "Trello", logo após foi criado todo o front-end, disponível para visualização e interação no seguinte link: <a href="https://leonardobevilacqua.github.io/Metrocamp-Web-projeto/Template/pages">https://leonardobevilacqua.github.io/Metrocamp-Web-projeto/Template/pages</a>, podendo clicar em "ENTRAR" e navegar nas páginas. Logo após, foi iniciado o processo de desenvolvimento, utilizando o <i>.net core</i>.',"paragraph-2":"Choose your game | página principal","paragraph-3":"Choose your game | página de perfil"},"java-engine":{cardTitle:"Java 2D Engine",cardDescription:"Estudo sobre desenvolvimento de jogos",name:"Java 2D Engine | Game development","paragraph-0":'Projeto criado para entender o funcionamento básico de uma engine, renderizando em 2D com suporte a multi jogador. A engine possui elementos baseados nas playlists do youtube de <a href="https://www.youtube.com/playlist?list=PL8CAB66181A502179"><i>Ryan van Zeben</i></a>, e <a href="https://www.youtube.com/playlist?list=PLah6faXAgguMnTBs3JnEJY0shAc18XYQZ"><i>CodeNMore</i></a>.',"paragraph-1":'Uma <a href="https://youtube.com/playlist?list=PL-OBuwg5uiFJSVfHHk-YSgj0VZdtk95FK">playlist</a> foi criada criada para demonstrar o progresso do desenvolvimento.',"paragraph-2":"Teste com multijogador","paragraph-3":"Teste com interação com cenário","paragraph-4":"Alteração da arte"},"blood-clicker":{cardTitle:"Blood-clicker",cardDescription:"Jogo educativo sobre doação de sangue",name:"Blood-clicker | Jogo educativo","paragraph-0":'Em 2019, ocorreu na faculdade UniMetrocamp a <b>"mostra de responsabilidade social"</b>, na qual fomos incentivados a realizar a criação de um jogo para conscientizar a doação de sangue. O meu jogo foi inspirado no jogo <i>"cookie clicker"</i>, no qual seu objetivo é juntar pontos e comprar melhorias. No jogo, a cada melhoria comprada, uma mensagem é exibida dando informações sobre doação de sangue. O jogo foi criado utilizando a <i>Godot Engine</i> e se encontra disponível no link: <a href="https://leonardobevilacqua.github.io/Blood-clicker/build/html/blood-clicker.html">https://leonardobevilacqua.github.io/Blood-clicker/build/html/blood-clicker.html</a>.',"paragraph-1":"Jogo blood clicker"},"3jobs":{cardTitle:"3Jobs",cardDescription:"Trabalho de conclusão de curso",name:"3Jobs | Trabalho de conclusão de curso","paragraph-0":"3Jobs é um projeto com a intenção de ser um facilitador para candidatos e vagas de emprego.  Permitindo que os headhunters encontrem, avaliem e indiquem com facilidade, ao Departamento de  Recursos Humanos (RH), os candidatos que melhor se adequam à determinada vaga.","paragraph-1":"O projeto foi organizado utilizando Kanban, no qual eu fiquei responsavel em gerenciar as tarefas dos outros membros do grupo e também da criação do frontend do sistema.","paragraph-2":"3Jobs | página inicial","paragraph-3":"3Jobs | página principal após login","paragraph-4":"3Jobs | página de perfil"},"prop-hunt":{cardTitle:"Prop Hunt 2D",cardDescription:"Jogo multiplayer",name:"Prop Hunt 2D | Jogo multiplayer","paragraph-0":"No inicio de 2020 iniciei um estudo e criação de um jogo simples em 2D, utilizando a <i>engine Godot</i>","paragraph-1":"O projeto teve como foco permitir o aprendizado da <i>engine</i> e o entendimento sobre o funcionamento básico de jogos multi jogador, sendo realizado o registro de cada evolução obtida durante o desenvolvimento. O projeto foi finalizado no fim de 2020.","paragraph-2":"O jogo funciona de forma simples, duas equipes, onde uma deve ser esconder e a outra deve procurar.","paragraph-3":"Início do projeto","paragraph-4":"Fim do projeto","paragraph-5":'Foi criado uma <a href="https://youtube.com/playlist?list=PL-OBuwg5uiFIGYAxFF3GRB57KsoBDg6Hl">playlist</a> com pequenos videos da evolução do projeto.'}};export{a as default};
